import React, { useState, useEffect } from 'react';

const Home = () => {
  const [animate, setAnimate] = useState(false);

  useEffect(() => {
    // Set animate to true after a delay (adjust the delay as needed)
    const timeout = setTimeout(() => {
      setAnimate(true);
    }, 1000); // Delay of 1 second (1000 milliseconds)

    return () => {
      clearTimeout(timeout);
    };
  }, []);

  return (
    <div className="text-center">
      <h1 className={animate ? 'blow-up-element' : ''}>
        <i>
          <b>Welcome to KITCHENERS SPELL</b>
        </i>
      </h1>
    </div>
  );
};

export default Home;
